import React from 'react';
import ReactDOM from 'react-dom/client';
import "./style.css"

const root=ReactDOM.createRoot(document.getElementById("root"))

function Navbar(){
  return(
    <div className='navbar'>
      <h1 className='navh1'>Perfumey</h1>
      <ul>
        <li>About|</li>
        <li>Product</li>
      </ul>
    </div>
  )
}

root.render(
  <div>
    <Navbar />
  </div>
)
